import React, { Component } from "react";
import './App.css';

const customers = [
  {
    id: 1,
    name: "Anna",
    surname: "Malinoska",
    age: 54
  },
  {
    id: 2,
    name: "Maciej",
    surname: "Wiśniewski",
    age: 22
  },
  {
    id: 3,
    name: "Ryszard",
    surname: "Polski",
    age: 37
  },

];
class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      customersList: customers
    };
  }

  renderCustomers = () => {
    const customersItems = this.state.customersList;
    return customersItems.map(item => (
        <li key={item.id}>
            <span>
              {item.name}
              {item.surname}
              {item.age}
            </span>
        </li>
    ));
  };

}

export default App;
